import React, { useEffect, useState } from "react";
import Papa from "papaparse";

function Filters({ onFilterChange }) {
  // Site state
  const [sites, setSites] = useState([]);
  const [searchQuery, setSearchQuery] = useState("");
  const [selectedSites, setSelectedSites] = useState([]);

  // Parameter state
  const [selectedParameters, setSelectedParameters] = useState([]);

  // Year range state
  const [availableYears, setAvailableYears] = useState([]);
  const [startYear, setStartYear] = useState(null);
  const [endYear, setEndYear] = useState(null);

  // 1. Load all site names from `locations.csv`
  useEffect(() => {
    fetch("/locations.csv")
      .then(response => response.text())
      .then(csvText => {
        Papa.parse(csvText, {
          header: true,
          skipEmptyLines: true,
          complete: (result) => {
            // Extract unique site names
            const allSites = result.data
              .map(row => row.name || row.Location)
              .filter(site => site); // remove any empty values
            const uniqueSites = [...new Set(allSites)].sort(); // Remove duplicates and sort
            setSites(uniqueSites);
          }
        });
      });
  }, []);

  // 2. Load unique years from `water_quality_data.csv`
  useEffect(() => {
    fetch("/water_quality_data.csv")
      .then(response => response.text())
      .then(csvText => {
        Papa.parse(csvText, {
          header: true,
          skipEmptyLines: true,
          complete: (result) => {
            processYearData(result.data);
          }
        });
      });
  }, []);

  // Process year range from water_quality_data.csv
  const processYearData = (data) => {
    const years = [...new Set(data.map(row => parseInt(row.Year)).filter(y => !isNaN(y)))];
    if (years.length === 0) return;
    years.sort((a, b) => a - b);
    const min = Math.min(...years);
    const max = Math.max(...years);
    setAvailableYears(years);
    setStartYear(min);
    setEndYear(max);

    // Update parent filters with default date range
    onFilterChange(prev => ({
      ...prev,
      startDate: new Date(min, 0, 1),
      endDate: new Date(max, 11, 31),
    }));
  };

  // Handle site search
  const filteredSites = sites.filter(site =>
    site.toLowerCase().includes(searchQuery.toLowerCase())
  );

  // Handle start/end year changes
  const handleStartYearChange = (event) => {
    const newStart = parseInt(event.target.value);
    if (newStart <= endYear) {
      setStartYear(newStart);
      onFilterChange(prev => ({
        ...prev,
        startDate: new Date(newStart, 0, 1),
      }));
    }
  };

  const handleEndYearChange = (event) => {
    const newEnd = parseInt(event.target.value);
    if (newEnd >= startYear) {
      setEndYear(newEnd);
      onFilterChange(prev => ({
        ...prev,
        endDate: new Date(newEnd, 11, 31),
      }));
    }
  };

  return (
    <div className="filters">
      {/* Site Filter */}
      <div className="filter-group">
        <input
          type="text"
          placeholder="Search sites..."
          className="search-box"
          value={searchQuery}
          onChange={(e) => setSearchQuery(e.target.value)}
        />
        <div className="site-list">
          {filteredSites.map(site => (
            <div
              key={site}
              className={`site-item ${selectedSites.includes(site) ? "selected" : ""}`}
              onClick={() => {
                const updatedSelection = selectedSites.includes(site)
                  ? selectedSites.filter(s => s !== site)
                  : [...selectedSites, site];
                setSelectedSites(updatedSelection);
                onFilterChange(prev => ({ ...prev, selectedSites: updatedSelection }));
              }}
            >
              {site}
            </div>
          ))}
        </div>
      </div>

      <hr className="filter-separator" />

      {/* Year Range Dropdowns */}
      <div className="filter-group">
        <span>Year Range:</span>
        <div className="year-dropdowns">
          <label>
            Start Year:
            <select
              value={startYear || ""}
              onChange={handleStartYearChange}
              className="year-select"
            >
              {availableYears.map(y => (
                <option key={y} value={y}>{y}</option>
              ))}
            </select>
          </label>
          <label>
            End Year:
            <select
              value={endYear || ""}
              onChange={handleEndYearChange}
              className="year-select"
            >
              {availableYears.map(y => (
                <option key={y} value={y}>{y}</option>
              ))}
            </select>
          </label>
        </div>
      </div>
    </div>
  );
}

export default Filters;
